import React from 'react';

import TableCell from '@material-ui/core/TableCell';
import TableRow from '@material-ui/core/TableRow';

class RankingCard extends React.Component {
  constructor(){
    super();
  }


  render() {
    return (
      <TableRow key={this.props.isKey}>
        <TableCell component="th" scope="row">
          {this.props.rank}
        </TableCell>

        <TableCell align="right">
          <img src={this.props.icon} />
        </TableCell>

        <TableCell align="right">{this.props.userName}</TableCell>
        <TableCell align="right">{this.props.bc}</TableCell>
        <TableCell align="right">BC</TableCell>
      </TableRow>
    );
  }
}

export default RankingCard;
